import Emily from '../../images/sample_image.jpg';

const useStyles = makeStyles({

});

function Tech_Team() {
    const classes = useStyles();
    return (
        <Grid container spacing={4} justify="center">
            <Grid item xs={4} >
                <MediaCard 
                    name="Lu Wang"
                    linkedin=""
                    image={Emily}/>
            </Grid>
            <Grid item xs={4} >
                <MediaCard />
            </Grid>
            <Grid item xs={4} >
                <MediaCard />
            </Grid>
        </Grid>
    )
}

export default Tech_Team
